import PropTypes from 'prop-types';
import React from 'react';

const Section = ({ title, children }) => {
    <div>
        <h2>{title}</h2>

    </div>
};

Section.propTypes = {
  title: PropTypes.string,
  children: PropTypes.element.isRequired,
};

export default Section;
